Good Girls Gone Bad!


On the way to high school reunion, Bibi Jones and gal pal Lilly Banks get stranded in the middle of nowhere when an old high school rival gives them dodgy directions. Their only oasis is a biker bar filled with wild characters. Hot and horny Christy Mack offers herself up to Ike Diesel in the middle of the bar. After an impromptu inking of Bibi would be tattoo artist Karlo Karrera bangs Bonnie Rotten.


